import React from "react";
import { BrowserRouter } from "react-router-dom";
import { Button, Nav, Navbar, Image } from "react-bootstrap";
import { Link } from "react-router-dom";
import Routes from "./routes";
//import "./App.css";

export default function App() {
  return (
    <>
      <BrowserRouter>
        <Navbar bg="dark" variant="dark">
          <Navbar.Brand as={Link} className="nav-link" to="/">Navbar</Navbar.Brand>
          <Nav className="mr-auto">
          <Nav.Item as={Link} className="nav-link" to="/">
            Início
          </Nav.Item>
          <Nav.Item as={Link} className="nav-link" to="/ocorrencias">
            Ocorrências
          </Nav.Item>
          <Nav.Item as={Link} className="nav-link" to="/ocorrencias_cadastro">
            Cadastrar
          </Nav.Item>
          <Nav.Item as={Link} className="nav-link" to="/dashboard">
            Dashboard
          </Nav.Item>
          </Nav>
        </Navbar>

        <Routes />
      </BrowserRouter>
    </>
  );
}
